// src/components/sections/Contact/Contact.jsx
import React from 'react';
import './Contact.scss';

const Contact = () => {
  return (
    <section id="contact" className="contact">
      <h2>Contact</h2>
      <div className="contact-content">
        {/* Add contact form or information here */}
      </div>
    </section>
  );
};

export default Contact;
